import React, { Component } from 'react';
import { CustomInput, Form, FormGroup, Label } from 'reactstrap';

export default class Post extends Component {
  render() {
    return (
      <Form>
          <FormGroup>
          <Label for="post">Post Thread</Label>
            <div>
                <input type="textarea" id="exampleCustomCheckbox" label="Write ur brain" />
            </div>
          </FormGroup>
      </Form>
    )
  }
}
